import styled from "styled-components";
import { BiChevronDown } from "react-icons/bi";
import { CiSearch } from "react-icons/ci";
import { RxPerson } from "react-icons/rx";
import { BiShoppingBag } from "react-icons/bi";

const Navbar = () => {
  const Btn = styled.button`
    background-color: #eb6d20;
    color: #fff;
    font-size: 13px;
    padding: 5px 20px 5px 20px;
    border-radius: 20px;
    width: 4.5rem;
    height: 2rem;
    @media (max-width: 1024px) {
      padding: 0 18px 0 18px;
  }
  `;
  return (
    <nav className='bg-[#FFF9F3] pl-[9%] pr-[20%] pb-30 max-lg:pl-0'>
      <div className='flex pt-5 space-x- items-center max-lg:space-x-0'>
      <img className='pl-[10%] max-lg:pl-0' src='/images/Logo.png' alt='logo' />
        <div className='bg-white flex text-sm bg-transparent px-1 py-1 w-[45rem] h-10 rounded-3xl max-lg:pl-0'>
          <div className='bg-[#F5F6F8] px-3 pl-5 text-base font-normal rounded-3xl flex items-center gap-1 w-[12rem] cursor-pointer hover:bg-[#dddddd] max-lg:w-[30%] max-lg:text-xs max-lg:px-3 max-lg:ml-0'>
            All categories
            <BiChevronDown className='text-xl cursor-pointer' />
          </div>
          <input
            type='search'
            name='Search'
            placeholder='Search anything'
            className='text-center w-[40rem] ml-5 rounded-3xl max-lg:w-[18rem]'
          />
          <CiSearch className='text-4xl pt-1 cursor-pointer pr-3 max-lg:text-3xl max-lg:pt-3' />
        </div>
        <Btn className='hover:underline'>Help</Btn>
        <div className='flex items-center gap-2 text-sm cursor-pointer hover:underline max-lg:gap-1 max-lg:pl-7  max-lg:pr-5'>
          <RxPerson className='text-lg hover:text-red-400 cursor-pointer' />
          Account
        </div>
        <div className='flex items-center gap-2 text-sm cursor-pointer hover:underline  max-lg:pl-4'>
          <BiShoppingBag className='text-lg hover:text-red-400 cursor-pointer' />
          Shopping
        </div>
      </div>

      {/* lineTwo */}

      <div className='lineTwo'>
        <ul className="flex space-x-16 pl-32">
          <li className="text-sm pt-7 pb-6 cursor-pointer hover:text-[#eb6d20] hover:underline  max-lg:pl-">Jewelry & Accessories</li>
          <li className="text-sm pt-7 pb-6 cursor-pointer hover:text-[#eb6d20] hover:underline">Clothing & Shoes</li>
          <li className="text-sm pt-7 pb-6 cursor-pointer hover:text-[#eb6d20] hover:underline">Home & Living</li>
          <li className="text-sm pt-7 pb-6 cursor-pointer hover:text-[#eb6d20] hover:underline">Wedding & Party</li>
          <li className="text-sm pt-7 pb-6 cursor-pointer hover:text-[#eb6d20] hover:underline">Toys & Entertainment</li>
          <li className="text-sm pt-7 pb-6 cursor-pointer hover:text-[#eb6d20] hover:underline">Art & Collectibles</li>
          <li className="text-sm pt-7 pb-6 cursor-pointer hover:text-[#eb6d20] hover:underline">Craft Supplies & Tools</li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
